import React, {Component} from "react";
import "./App.css";
import PageTreeData from "./page-tree/data.js";
import Page from "./components/page.js";

class App extends Component {
  constructor(props) {
    super(props);
    this.itemList = [];
  }
  render() {
    return (
      <div className="App">
        <Page pages={this.itemList}/>
      </div>
    );
  }

  componentDidMount() {
    PageTreeData().then(result => {
        const nestedList = [];
        const item = object => {
          return (<div id={object.id}>{object.name}</div>);
        }

        const addAllItems = (pages) => {
          pages.forEach(page => {
            nestedList.push(item(page));
            if (page.hasOwnProperty("children")) {
              addAllItems(page.children);
            }
          });
        }

        addAllItems(result);
        this.setState('itemList', nestedList);
      });
  }
}

export default App;
